import React, { useState } from "react";

function List(props) {
	const [clicked, setClicked] = useState(false);
	return (
		<div
			onClick={() => {
				props.onClicked(props.id);
			}}>
			<li>{props.text}</li>
		</div>
	);
}

export default List;
